import "./Header.css";

const Header = () => {
    return ( 
        <header className="cabeçalho">
              <img className="logo" src="../../image/logo-vittude.svg" alt="logo"></img> 
           <nav>
              <ul>
                <li>Como funciona</li>
                <li>Para você</li>
                <li>Para psicólogos</li>
                <li>Para empresas</li>
                <li>Blog</li>
              </ul>

           </nav> 

        </header>
     );
};

export default Header;
